"use strict";{let isDesktopApp=webui._appSettings.isDesktopApp,appType=webui._appSettings.appType||"website",hostType=isDesktopApp?"app":"browser";function build_options(){let btnMemTheme="warning",btnSesTheme="warning",btnLocTheme="warning";switch(webui.storage.getItem(webui.storage.STORAGE_ACCEPTED_KEY)){case"2":btnLocTheme="active";break;case"1":btnSesTheme="active";break;default:btnMemTheme="active"}let options=[{name:"Memory-only Storage (default behavior - Maximum Security)",theme:btnMemTheme,body:`\n<webui-paper>\n\nWith this storage option, any login, settings, or other persistable information will only be retained in memory, and will be gone when the ${appType} is either closed or refreshed.\n\n</webui-paper>\n\n<webui-paper>\n\nUse this option when:\n\n</webui-paper>\n\n<webui-paper>\n\n- You are on a public computer, or some other device that is not yours.\n- You do not want any personal data stored in any storage that will persist beyond a page refresh.\n- You want to make sure you are required to login everytime you access this ${appType}, even when you simply reload the page.\n- You have opted-in to storing your data on this computer. Selecting this option now will result in clearing any data saved from storage.\n\n</webui-paper>\n\n<webui-flex grow></webui-flex>\n\n<webui-button theme="${btnMemTheme}" data-trigger="${webui.storage.STORAGE_ACCEPTED_KEY}" data-value="${webui.storage.REJECT_STORAGE_CACHING}">\n\nI confirm this is not my personal device or I simply want to assure a login is required everytime I access this ${appType}.\n\n</webui-button>\n`},{name:"Long-term Storage (Lowest Security)",theme:btnLocTheme,body:`\n<webui-paper>\n\nWith this storage option, you only need to consent and login once. Your login will persist even after closing and reopening this ${appType}.\n\n</webui-paper>\n\n<webui-paper>\n\nUse this option when:\n\n</webui-paper>\n\n<webui-paper>\n\n- You are on your personal device.\n- Your device is secure from other people accessing it.\n- You want to remain logged in until you explicitely logout.\n\n</webui-paper>\n\n<webui-flex grow></webui-flex>\n\n<webui-button theme="${btnLocTheme}" data-trigger="${webui.storage.STORAGE_ACCEPTED_KEY}" data-value="${webui.storage.ACCEPT_LOCAL_STORAGE}">\n\nI confirm that I am using my personal device and that I understand the above statements and I accept the use of storing my data in the ${hostType} so my login and other data will be remembered any time I access this ${appType}.\n\n</webui-button>\n`}];isDesktopApp||options.splice(1,0,{name:"Single Session/Tab Storage (Medium Security)",theme:btnSesTheme,body:`\n<webui-paper>\n\nWith this storage option, any time you open a new tab and visit this ${appType}, you will need to consent to storage and login in order to access your account features.\n\n</webui-paper>\n\n<webui-paper>\n\nUse this option when:\n\n</webui-paper>\n\n<webui-paper>\n\n- You are on your personal device.\n- You will logout before leaving your device accessible to others.\n- You want to stay logged in if you refresh the page, but be logged out once you close your ${hostType} or if visiting this ${appType} in a new tab or window.\n\n</webui-paper>\n\n<webui-flex grow></webui-flex>\n\n<webui-button theme="${btnSesTheme}" data-trigger="${webui.storage.STORAGE_ACCEPTED_KEY}" data-value="${webui.storage.ACCEPT_SESSION_STORAGE}">\n\nI confirm that I am using my personal device and that I understand the above statements and I accept the use of storing my data in the ${hostType} so my login and other data will be remembered until the I close the ${hostType}.\n\n</webui-button>\n`}),webui.setData("page-storage-consent-options",JSON.stringify(options))}webui.define("webui-myfi-storage-consent",{constructor:t=>{},setAcceptedKey:function(value){switch(value){case webui.storage.ACCEPT_LOCAL_STORAGE:webui.storage.acceptLocalStorage(),this.render();break;case webui.storage.ACCEPT_SESSION_STORAGE:webui.storage.acceptSessionStorage(),this.render();break;case webui.storage.REJECT_STORAGE_CACHING:webui.storage.rejectCachedStorage(),this.render();break;default:console.log("Unknown accepted key",value)}},render:function(){build_options(),this.innerHTML=webui.applyAppDataToContent(`\n## Storage Concent\n\n<webui-page-segment elevation="10">\n\n<webui-paper>\n\nThis ${appType} has multiple levels of data storage available for you to choose from, which will determine how data is stored on your device for this ${appType}.\n\n</webui-paper>\n\n<webui-cards card-width="500" data-set="setCards" data-subscribe="page-storage-consent-options"></webui-cards>\n\n</webui-page-segment>\n`)},connected:t=>{t.setAttribute("data-set","setAcceptedKey"),t.setAttribute("data-subscribe",webui.storage.STORAGE_ACCEPTED_KEY),t.render()}})}